import React, { useState } from "react";

const ClearAllTodos = () => {
  const word = {
    title: "jopa",
    isComp: false,
  };

  const [done, setDone] = useState(false);


  return (
    <div className="text-white text-center text-2xl">
      <span>{word}</span> <br />
      <button>START</button>
    </div>
  );
};

export default ClearAllTodos;
